import React, { Component } from 'react'
import * as ACTION_TYPES from '../store/actions/action_types'
import * as ACTIONS from '../store/actions/actions'

import { connect } from 'react-redux'
import { fail } from 'assert'

class Container_one extends Component {
    render() {
        return (
            <div>
                <button onClick={console.log(this.state.prop_one)}>Get State</button>
                <button onClick={this.actionToSucccess}>Dispatch Action One</button>
                <button onClick={this.actionToSFailure}>Dispatch Action Two</button>

            </div>
        )
    }


}

//get state from redux
function mapStateToProps(state) {
    return {
        prop_one:this.state.prop_one
    }
}

function mapDispatchToProps(dispatch) {
   return{
       actionToSucccess: () => dispatch(ACTIONS.SUCCESS),
       actionToSFailure: () => dispatch(ACTIONS.FAILURE),
   }

}

export default Container_one
